import speech_recognition as sr
from gtts import gTTS
import pygame
import google.generativeai as genai
genai.configure(api_key="")
model = genai.GenerativeModel('gemini-1.0-pro-latest')
import re

def convert_to_normal_passage(text, word_limit=100):
    cleaned_text = text.replace("*", "").replace("**", "")
    sentences = re.split(r'(?<=[.!?]) +', cleaned_text)
    accumulated_words = []
    total_words = 0
    
    for sentence in sentences:
        sentence_words = sentence.split()
        if total_words + len(sentence_words) <= word_limit:
            accumulated_words.extend(sentence_words)
            total_words += len(sentence_words)
        else:
            break
    limited_text = " ".join(accumulated_words)
    
    return limited_text
while True:
    TEXT_OUTPUT_FILENAME = 'output.mp3'
    recognizer = sr.Recognizer()

    with sr.Microphone(device_index=2, sample_rate = 48000) as source:

        audio = recognizer.listen(source,timeout=6)

    try:
        text = recognizer.recognize_google(audio)
        print("Converted audio to text:")
        text=convert_to_normal_passage(text)
        print(text)
        
        if "ok google" in text.lower():
            print("The phrase 'OK Google' was detected in the audio.")
            break
        else:
            print("The phrase 'OK Google' was not detected in the audio.")
        text1=model.generate_content("what is"+text).text
        text1=convert_to_normal_passage(text1)
        print(text1)
        
        tts = gTTS(text=text1, lang='en')
        tts.save(TEXT_OUTPUT_FILENAME)
        print(f"Converted text to audio and saved to {TEXT_OUTPUT_FILENAME}")

        # Play the converted audio file
        pygame.mixer.init()
        pygame.mixer.music.load(TEXT_OUTPUT_FILENAME)
        pygame.mixer.music.play()

        while pygame.mixer.music.get_busy():
            continue
    except sr.UnknownValueError:
        print("Google Speech Recognition could not understand audio")
    except sr.RequestError as e:
        print(f"Could not request results from Google Speech Recognition service; {e}")
        
        
print("Welcome to the Server")




